import React from 'react';
// import {Card} from 'react-bootstrap/Card';
import Card from 'react-bootstrap/Card'
import './card.css';

function card() {
    const cardStyle = {width: '200px', height: '200px'}
    return (
        <div>
            <Card className="card-full" style={cardStyle}>
                <Card.Title>Pokedex</Card.Title>
                <Card.Body>
                    A Pokemon matching game utilizing React Hooks, and state management.
                </Card.Body>
            </Card>

        </div>
    )
}

export default card
